import React, { useEffect } from "react";
import axios from "axios";

const App = () => {
  useEffect(() => {
    const call = async () => {
      const weather = await axios.get(
        "http://api.weatherapi.com/v1/current.json?key=21916b1a020d4a33bb534916203108&q=London"
      );
    };
  });

  return <h1>hello</h1>;
};

export default App;
